import React, { useContext } from 'react';
import { MyContext } from '../provider/MyProvider';

export default function NextAndPrevious() {
  const { setDataAPI } = useContext(MyContext);

  return (
    <div>
      <button
        type="button"
      >
        Previous
      </button>
      <button
        type="button"
      >
        Next
      </button>
    </div>
  );
}
